'''Goblin fish''' or '''cave pond loaches''' are a species of subterranean [[fish]] native to the underground city of [[Dorgesh-Kaan]]. They are named so either because they are found in the goblin city or because they somewhat resemble [[cave goblin]]s (pale green skin and bulging eyes).

They appear in the shallow pools of Dorgesh-Kaan, north and south of the city's marketplace, but cannot actually be caught through [[Fishing]]. 
They are however caught and eaten steamed by the cave goblins, who refer to them as [[Loach]]es, and can be obtained by [[Dorgesh-Kaan market trading|exchanging food]] with [[gourmet]]s in the Dorgesh-Kaan marketplace.
[[File:Goblin fish.gif|thumb|left|A goblin fish jumping out of the water.]]

==Trivia==
*Its appearance is similar to that of a {{WP|Blobfish}}.

